        <label>шт.</label>
      </div>
      <div className="order-price">
        <h4>1 190 ₽</h4>
      </div>
      <div className="order-delete">
        <i className="fas fa-trash-alt"></i>
      </div>
    </div>
  );
};

export default BasketOrderItem;
